import React, {useEffect} from 'react';
import { connect } from 'react-redux';
import { getData } from '../../redux/actions';

const ListUsers = ({ users }) => (
  <ul className="list-group list-group-flush">
    {users.map((el) => (
      <li className="list-group-item" key={el.id}>
        {el.first_name}
      </li>
    ))}
  </ul>
);
  useEffect(() => {
    getData();
  }, [getData]);

